import React, { Component } from "react";
import { subscribeToClosetFeed } from "../../utils/ClosetFeed";
import "./style.css";
import API from "../../utils/API";
class ClosetFeed extends Component {
  constructor(props) {
    super(props);
    console.log(props);
    subscribeToClosetFeed((err, res) =>
      API.getOutfit(res._id)
        .then(outfit => {
          this.setState({
            outfit: outfit.data
          });
        })
        .catch(err => console.log(err))
    );
  }

  state = {
    outfit: "no data yet"
  };

  render() {
    return (
      <p className="feed">
        {/* <a href={this.state.bookLink}>{this.state.bookTitle}</a> */}
        {this.state.outfit.user.username}
      </p>
    );
  }
}

export default ClosetFeed;
